import React from "react";

import classes from "./FriendCard.module.css";

const FriendCard = (props) => {
  return (
    <li>
      <div className={classes.onefriend}>
        <p>{props.key}</p>
        <h3>{props.name}</h3>
        <p>{props.email}</p>
        <p>{props.birthday.split("T")[0]}</p>
        <p>{props.city}</p>
      </div>
    </li>
  );
};

export default FriendCard;
